export default function Counter(){

    function Increamentby1(){
        console.log('Increased by 1')
    }


    return(
        <>
        <span className="Increment">0</span>
        <div><button className="Increasedby1" onClick={Increamentby1}>Increase by 1</button></div>        
        
        </>

    );
}
